export class Cliente {
    set nome(nome) {
        this._nome;
    }
    get nome() {
        return this._nome;
    }
    set sobrenome(nome) {
        this._sobrenome;
    }
    get sobrenome() {
        return this._sobrenome;
    }
    set idade(idade) {
        this._idade;
    }
    get idade() {
        return this._idade;
    }
    set valor(valor) {
        this._valor;
    }
    get valor() {
        return this._valor;
    }
}
